import img3 from "../imge/img-3.jpeg";
import img4 from "../imge/img-4.jpeg";
import img5 from "../imge/img-5.jpeg";
import img6 from "../imge/img-6.jpeg";

function RoomDetail() {
  return (
    <div className="rooms__detail__container">
      <div className="rooms__detail__wrapper">
        <div className="rooms__derail__items">
          <RoomDetailItem img="" />
        </div>
      </div>
    </div>
  );
}

export default RoomDetail;
